LAHORE, Feb 6 (APP): Former Members of Punjab Assembly (MPAs) Khawaja Salman Rafique, Ms. Rabia Naseem Farooqi and Mian Marghoob Ahmad separately called on Prime Minister Muhammad Shehbaz Sharif here on Monday.
Overall political situation in Punjab was discussed during the meetings.
